import { React, useState, useEffect } from "react";
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardHeader,
  MDBCardFooter,
  MDBBtn,
} from "mdb-react-ui-kit";
import Toast from "react-bootstrap/Toast";

export default function NotificationToast(props) {
    var timestamp = new Date(props.alert.timestamp)
    return (
    <Toast
        className="mb-2"
        bg="light"
        style={{ width: "100%" }}
      >
        <Toast.Header>
          <strong className="me-auto">Auftrags-ID {props.alert.actor_object_id}</strong>
          <small>{timestamp}</small>
        </Toast.Header>
        <Toast.Body>
          Transaktion wurde angelegt
        </Toast.Body>
      </Toast>



    )
}
